package sp.report.vo;

public class PactCheck {
	private int check;
	private int pact;
	public PactCheck() {
		super();
		// TODO Auto-generated constructor stub
	}
	public PactCheck(int check, int pact) {
		super();
		this.check = check;
		this.pact = pact;
	}
	public int getCheck() {
		return check;
	}
	public void setCheck(int check) {
		this.check = check;
	}
	public int getPact() {
		return pact;
	}
	public void setPact(int pact) {
		this.pact = pact;
	}
	
}
